import React, { useState } from 'react';
import './style/App.css';
import TelaInicial from "./components/TelaInicial";
function App() {
    const changeRota = (value) => {
        console.log('value: ', value)
        rota = value
    }
    return <TelaInicial rota={rota} onCadastrar={event => changeRota('Cadastro') } onVoltar={event => changeRota('Login') }/>;
}

export default App;
